#!/bin/bash

#用到哪，学到哪。
#bash <(curl -sSL https://get.docker.com)；安装docker
#systemctl start sshd = service sshd start；系统服务
#ps -ef | grep 进程名 | grep -v grep | awk '{print $2}' | xargs kill -9；查找并关闭进程
#chmod +x script.sh；赋予执行权限
#chmod -R 755 /opt/frps && chown root:root -R /opt/frps；赋予文件权限 -R递归修改目录
#tar -zcvf Mu.tar.gz /etc/nginx/Mu；压缩指定目录 tar -zcvf 文件名.tar.gz /文件目录
#tar -xzvf /etc/nginx/Mu.tar.gz -C /etc/nginx；解压指定目录
#base64 -w 0 Mu.tar.gz > Mu.txt；base64编码
#base64 -d /etc/nginx/Mu.txt > /etc/nginx/Mu.tar.gz；base64解码
#cat > file << EOF；覆盖&转义(文本中不需要转义的特殊符号前加\)
#cat >> file << 'EOF'；追加&禁止转义(开头EOF加上''即可)
#set -e(错误退出)；set -u(退出报错)；set -x(显示命令)
#./test.sh 1> stout.txt 2> sterr.txt；将正确信息输出到stout.txt中，将错误信息输出到sterr.txt中
#./test.sh > stout.txt；将正确信息输出到stout.txt中，将错误信息输出到屏幕上
#./test.sh 2> sterr.txt；将错误信息输出到sterr.txt中，将正确信息输出到屏幕上
#./test.sh > test.txt 2>&1；将stdout和stderr输出到test.txt中
#./test.sh > stout.txt；同下
#./test.sh 1> stout.txt；同上
# ！逻辑中的非、不是；
#if ! 命令; then echo "命令错误"; exit 1; fi；错误退出
#if [ -s 文件]；如果文件存在或size大于0)
#if [ ! -s 文件]；如果文件不存在或size等于0
#if [ -z $string]；如果变量等于0或空)
#if [ ! -z $string]；如果变量大于0或非空
#/dev/null黑洞，用于丢弃任何写入它的数据；
#命令 > /dev/null 2>&1；将正确信息和错误信息重定向/dev/null不显示到屏幕上；
#命令 2>&1 > /dev/null；将错误信息显示到屏幕；正确信息输出/dev/null不显示到屏幕上；
#find / *.txt 2>/dev/null；根目录中没有权限，错误信息太多，显示正确信息；

echo -e "\e[35m\n#Mu\e[0m"
set -u

# 关闭SELINUX
#if [ -s /etc/selinux/config ] && grep 'SELINUX=enforcing' /etc/selinux/config; then; sed -i 's/SELINUX=enforcing/SELINUX=disabled/g' /etc/selinux/config; setenforce 0; fi

# 检查系统
arch=$(uname -m)
case $arch in
    x86_64)        Is_64bit='y'; ARCH="amd64";;
    aarch64)       Is_64bit='y'; ARCH="arm64";;
    arm*|armv*)    Is_64bit='n'; ARCH="arm";;
    mips)          Is_64bit='n'; ARCH="mips";;
    mips64)        Is_64bit='y'; ARCH="mips64";;
    mips64el)      Is_64bit='y'; ARCH="mips64le";;
    mipsel)        Is_64bit='n'; ARCH="mipsle";;
    riscv64)       Is_64bit='y'; ARCH="riscv64";;
    *)             echo "未知系统！";;
esac

# Nginx
if [ ! -s /etc/nginx/Mu ]; then
echo -e "\e[32m安装nginx和certbot。\e[0m"
sudo apt install -y nginx certbot

echo -e "\e[32m解压html。\e[0m"
cat > /etc/nginx/Mu.txt << 'TARGZ'

TARGZ
base64 -d /etc/nginx/Mu.txt > /etc/nginx/Mu.tar.gz
tar -xzvf /etc/nginx/Mu.tar.gz -C /etc/nginx

# 覆盖nginx.conf
cat > /etc/nginx/nginx.conf << 'CONFIG'
#Mu
user nginx;
pid /run/nginx.pid;
worker_processes auto;
worker_rlimit_nofile 65535;

# Load modules
include /etc/nginx/modules-enabled/*.conf;

events {
    multi_accept on;
    worker_connections 65535;
}

http {
    charset utf-8;
    sendfile on;
    tcp_nopush on;
    tcp_nodelay on;
    server_tokens off;
    log_not_found off;
    types_hash_max_size 2048;
    types_hash_bucket_size 64;
    client_max_body_size 16M;

    # MIME
    include mime.types;
    default_type application/octet-stream;

    # Logging
    access_log off;
    error_log /dev/null;

    # SSL
    ssl_session_timeout 1d;
    ssl_session_cache shared:SSL:10m;
    ssl_session_tickets off;

    # Diffie-Hellman parameter for DHE ciphersuites
    ssl_dhparam /etc/nginx/dhparam.pem;

    # Mozilla Intermediate configuration
    ssl_protocols TLSv1.2 TLSv1.3;
    ssl_ciphers ECDHE-ECDSA-AES128-GCM-SHA256:ECDHE-RSA-AES128-GCM-SHA256:ECDHE-ECDSA-AES256-GCM-SHA384:ECDHE-RSA-AES256-GCM-SHA384:ECDHE-ECDSA-CHACHA20-POLY1305:ECDHE-RSA-CHACHA20-POLY1305:DHE-RSA-AES128-GCM-SHA256:DHE-RSA-AES256-GCM-SHA384;

    # Limits
    limit_req_log_level warn;
    limit_req_zone $binary_remote_addr zone=login:10m rate=10r/m;

    # Gzip
    gzip on;
    gzip_vary on;
    gzip_proxied any;
    gzip_comp_level 6;
    gzip_buffers 16 8k;
    gzip_types text/plain text/css text/xml application/json application/javascript application/rss+xml application/atom+xml image/svg+xml;

    # Security headers
    add_header X-Frame-Options "SAMEORIGIN" always;
    add_header X-Content-Type-Options "nosniff" always;
    add_header X-XSS-Protection "1; mode=block" always;
    add_header Permissions-Policy "interest-cohort=()" always;
    add_header Referrer-Policy "no-referrer-when-downgrade" always;
    add_header Strict-Transport-Security "max-age=31536000; includeSubDomains; preload" always;
    add_header Content-Security-Policy "default-src 'self' http: https: ws: wss: data: blob: 'unsafe-inline'; frame-ancestors 'self';" always;

    # Load configs
    include /etc/nginx/conf.d/*.conf;
    include /etc/nginx/sites-enabled/*;
}
CONFIG
fi

# SSL
if [ ! -s /etc/letsencrypt/live ]; then
    read -r -p "请输入域名：" domain
	echo -e "域名：\e[35m$domain\e[0m"
	while true; do
	    read -r -p "请确认域名[Yes/No]：" input
		case $input in
		    [yY][eE][sS]|[yY]) echo -e "\e[35m已确认。\e[0m"
			    break
				;;
			[nN][oO]|[nN]) echo -e "\e[32m请重新输入。\e[0m"
			    read -r -p "请输入域名：" domain
				echo -e "域名：\e[35m$domain\e[0m"
				;;
			*) echo -e "\e[31m错误，请重新输入！\e[0m"
			    sleep 1
				continue
				;;
		esac
	done
	echo -e "\e[32m申请SSL证书。\e[0m"
	openssl dhparam -out /etc/nginx/dhparam.pem 2048
	certbot certonly --webroot --force-renewal --agree-tos -n -w /var/www/html -m ssl@cert.bot -d $domain
else
    while true; do
	    echo -e "\e[32m检测到已有SSL证书。\e[0m"
		echo -e "\e[32m1）强制申请\e[0m"
		echo -e "\e[32m2）重新申请\e[0m"
		echo -e "\e[32m3）跳过申请\e[0m"
		read -p "请输入选项：" OPTION
		case $OPTION in
		    1)
			    echo -e "\e[32m强制申请SSL证书。\e[0m"
				domain="$(ls -l /etc/letsencrypt/live |awk '/^d/ {print $NF}')"
				certbot certonly --webroot --force-renewal --agree-tos -n -w /var/www/html -m ssl@cert.bot -d $domain
				break
				;;
			2)
			    echo -e "\e[32m重新申请SSL证书。\e[0m"
				read -r -p "请输入域名：" domain
				echo -e "域名：\e[35m$domain\e[0m"
				while true; do
				    read -r -p "请确认域名[Yes/No]：" input
					case $input in
					    [yY][eE][sS]|[yY]) echo -e "\e[35m已确认。\e[0m" ; break ;;
						[nN][oO]|[nN]) echo -e "\e[32m请重新输入。\e[0m" ; read -r -p "请输入域名：" domain ; echo -e "域名：\e[35m$domain\e[0m" ;;
						*) echo -e "\e[31m错误，请重新输入！\e[0m" ; sleep 1 ; continue ;;
					esac
				done
				rm -rf /etc/letsencrypt/live
				rm -rf /etc/nginx/conf.d/FLO.conf
				echo -e "\e[32m申请SSL证书。\e[0m"
				certbot certonly --webroot --force-renewal --agree-tos -n -w /var/www/html -m ssl@cert.bot -d $domain
				break
				;;
			3)
			    echo -e "\e[32m跳过申请SSL证书。\e[0m"
				exit 0
				;;
			*)
			    echo -e "\e[31m错误，请重新输入！\e[0m"
				sleep 1
				continue
				;;
		esac
	done
fi

# 创建FLO.conf
if [ ! -s /etc/nginx/conf.d/FLO.conf ]; then
cat > /etc/nginx/conf.d/FLO.conf << FLO
#Mu
server {
    listen 80;
    listen [::]:80;
    listen 443 ssl http2;
    listen [::]:443 ssl http2;
    server_name $domain;
    return 301 https://$domain\$request_uri;

    # SSL
    ssl_certificate /etc/letsencrypt/live/$domain/fullchain.pem;
    ssl_certificate_key /etc/letsencrypt/live/$domain/privkey.pem;

    # Root
    location / {
        root /etc/nginx/Mu;
    }

    # Reverse proxy
    location /lk {
        proxy_pass http://127.0.0.1:16601;
        proxy_set_header Host \$host;
		
		# Proxy headers
        proxy_http_version 1.1;
        proxy_ssl_server_name on;
        proxy_set_header Connection "upgrade";
        proxy_set_header Upgrade $http_upgrade;
        proxy_set_header X-Real-IP $remote_addr;
        proxy_set_header X-Forwarded-Host $host;
        proxy_set_header X-Forwarded-Proto $scheme;
        proxy_set_header X-Forwarded-Port $server_port;
        proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
        proxy_connect_timeout 60s;
        proxy_send_timeout 60s;
        proxy_read_timeout 60s;
    }

    # Favicon.ico
    location = /favicon.ico {
        log_not_found off;
    }

    # Robots.txt
    location = /robots.txt {
        log_not_found off;
    }

    # . files
    location ~ /\.(?!well-known) {
        deny all;
    }

    # ACME-challenge
    location ^~ /.well-known/acme-challenge/ {
        root /var/www/html;
    }

    # Logging
    access_log /var/log/nginx/access.log combined buffer=512k flush=1m;
    error_log  /var/log/nginx/error.log warn;
}

# subdomains redirect
server {
    listen 443 ssl http2;
    listen [::]:443 ssl http2;
    server_name *.$domain;
    return 301 https://$domain\$request_uri;
    ssl_certificate /etc/letsencrypt/live/$domain/fullchain.pem;
    ssl_certificate_key /etc/letsencrypt/live/$domain/privkey.pem;
}
FLO

# 覆盖default
cat > /etc/nginx/sites-available/default << DEFAULT
server {
    listen 80 default_server;
    listen [::]:80 default_server;
    listen 443 ssl http2 default_server;
    listen [::]:443 ssl http2 default_server;
    server_name _;
    return 301 https://$domain\$request_uri;
    ssl_certificate /etc/letsencrypt/live/$domain/fullchain.pem;
    ssl_certificate_key /etc/letsencrypt/live/$domain/privkey.pem;
}
DEFAULT

# 创建软连接
#sudo ln -sf /etc/nginx/sites-available/default /etc/nginx/sites-enabled/default

echo -e "\e[35mNginx配置完成！\e[0m"
sudo nginx -t && sudo nginx -s reload
fi

# frp
FRPPATH="/opt/Mu/frps"
FRPFILE="https://github.com/fatedier/frp/releases/download"
FRPAPI="https://api.github.com/repos/fatedier/frp/releases/latest"
VER="$(curl -s $FRPAPI | grep '"tag_name":' | cut -d '"' -f 4 | cut -c 2-)"

# 结束进程
while ! test -z $(ps -ef | grep frps | grep -v grep); do
    pkill -9 frps
done

if [ -s /lib/systemd/system/frps.service ]; then
    while true; do
	    echo -e "\e[32m检测到已安装frps。\e[0m"
		echo -e "\e[32m1）升级\e[0m"
		echo -e "\e[32m2）退出\e[0m"
		read -p "请输入选项：" OPTION
		case $OPTION in
		    1)
			    if [ ! -z $VER ]; then
				    FRPTAR="frp_${VER}_linux_${ARCH}.tar.gz"
					FRPURL="${FRPFILE}/v${VER}/${FRPTAR}"
					echo -e "\e[32m下载$FRPTAR\e[0m"
					curl -L $FRPURL -o $FRPTAR
					if [ -s $FRPTAR ]; then
					echo -e "\e[32m提取$FRPTAR\e[0m"
					mkdir -p $FRPPATH
					tar xzvf $FRPTAR
					mv -f frp_${VER}_linux_${ARCH}/frps ${FRPPATH}
					rm -rf ${FRPTAR} frp_${VER}_linux_${ARCH}
				else
				    echo -e "\e[31m未找到文件！\e[0m"
					read -r -p "请输入链接：" FRPURL
					echo -e "\e[32m下载$FRPTAR\e[0m"
					curl -L $FRPURL -o $FRPTAR
					echo -e "\e[32m提取$FRPTAR\e[0m"
					mkdir -p $FRPPATH
					tar xzvf $FRPTAR
					mv -f frp_${VER}_linux_${ARCH}/frps ${FRPPATH}
					rm -rf ${FRPTAR} frp_${VER}_linux_${ARCH}
				fi
				read -r -p "请输入USERNAME：" USERNAME
				read -r -p "请输入PASSWORD：" PASSWORD
				TOKEN="${USERNAME}${PASSWORD}"
				echo -e "TOKEN：\e[35m$TOKEN\e[0m"
				while true; do
				    read -r -p "请确认令牌[Yes/No]：" input
					case $input in
					    [yY][eE][sS]|[yY]) echo -e "\e[35m已确认。\e[0m" ; TOML=TOML ; break ;;
						[nN][oO]|[nN]) echo -e "\e[32m请重新输入。\e[0m" ; read -r -p "请输入USERNAME：" USERNAME ; read -r -p "请输入PASSWORD：" PASSWORD ;;
						*) echo -e "\e[31m错误，请重新输入！\e[0m" ; sleep 1 ; continue ;;
					esac
				done
				break
				;;
			2)
			    echo -e "\e[32m退出。\e[0m"
				exit 0
				;;
	done
else
    if [ ! -z $VER ]; then
	    FRPTAR="frp_${VER}_linux_${ARCH}.tar.gz"
		FRPURL="${FRPFILE}/v${VER}/${FRPTAR}"
		echo -e "\e[32m下载$FRPTAR\e[0m"
		curl -L $FRPURL -o $FRPTAR
	    if [ -s $FRPTAR ]; then
	    echo -e "\e[32m提取$FRPTAR\e[0m"
		mkdir -p $FRPPATH
		tar xzvf $FRPTAR
		mv -f frp_${VER}_linux_${ARCH}/frps ${FRPPATH}
		rm -rf ${FRPTAR} frp_${VER}_linux_${ARCH}
	else
	    echo -e "\e[31m未找到文件！\e[0m"
		read -r -p "请输入链接：" FRPURL
		echo -e "\e[32m下载$FRPTAR\e[0m"
		curl -L $FRPURL -o $FRPTAR
		echo -e "\e[32m提取$FRPTAR\e[0m"
		mkdir -p $FRPPATH
		tar xzvf $FRPTAR
		mv -f frp_${VER}_linux_${ARCH}/frps ${FRPPATH}
		rm -rf ${FRPTAR} frp_${VER}_linux_${ARCH}
	fi
	read -r -p "请输入USERNAME：" USERNAME
	read -r -p "请输入PASSWORD：" PASSWORD
	TOKEN="${USERNAME}${PASSWORD}"
	echo -e "TOKEN：\e[35m$TOKEN\e[0m"
	while true; do
	    read -r -p "请确认令牌[Yes/No]：" input
		case $input in
		    [yY][eE][sS]|[yY]) echo -e "\e[35m已确认。\e[0m" ; TOML=TOML ; break ;;
			[nN][oO]|[nN]) echo -e "\e[32m请重新输入。\e[0m" ; read -r -p "请输入USERNAME：" USERNAME ; read -r -p "请输入PASSWORD：" PASSWORD ;;
			*) echo -e "\e[31m错误，请重新输入！\e[0m" ; sleep 1 ; continue ;;
		esac
	done
fi

if [ $TOML = TOML ]; then
# 配置frps.toml
cat > ${FRPPATH}/frps.toml << TOML
bindAddr = "0.0.0.0"
bindPort = 7000
quicBindPort = 7000

vhostHTTPPort = 60080
vhostHTTPSPort = 60443

transport.maxPoolCount = 2000
transport.tcpMux = true
transport.tcpMuxKeepaliveInterval = 60
transport.tcpKeepalive = 7200
transport.tls.force = false

webServer.addr = "0.0.0.0"
webServer.port = 7500
webServer.user = "$USERNAME"
webServer.password = "$PASSWORD"
webServer.pprofEnable = false

auth.method = "token"
auth.token = "$TOKEN"

log.to = "./frps.log"
log.level = "info"
log.maxDays = 3
log.disablePrintColor = false

allowPorts = [
  { start = 10001, end = 50000 }
]

maxPortsPerClient = 0
udpPacketSize = 1500
natholeAnalysisDataReserveHours = 168
TOML

# 配置frps.service
cat > /lib/systemd/system/frps.service << FRPS
[Unit]
Description=Frp Server Service
After=network.target syslog.target
Wants=network.target

[Service]
Type=simple
Restart=on-failure
RestartSec=5s
ExecStart=$FRPPATH -c ${FRPPATH}/frps.toml

[Install]
WantedBy=multi-user.target
FRPS

# 启动
chown root:root -R $FRPPATH && chmod 755 $FRPPATH
sudo systemctl daemon-reload
sudo systemctl start frps
sudo systemctl enable frps
fi

#echo -e "\e[32mvim 按下i进入编辑模式 | 按下ecs退出编辑模式 | 输入:wq(!强制)保存并退出，输入:q!退出不保存\e[0m"
#sudo vim /etc/ssh/sshd_config

# 更改SSH端口
echo -e "\e[32mPort ***** | PermitRootLogin yes | PubkeyAuthentication yes | PasswordAuthentication no\e[0m"
read -r -p "请输入SSH端口：" sshport
echo -e "SSH端口：\e[35m$sshport\e[0m"

# 写入sshd
cat >> /etc/ssh/sshd_config << SSHD
Port $sshport
PermitRootLogin yes
PubkeyAuthentication yes
PasswordAuthentication no
SSHD

# 开启防火墙
#iptables -A INPUT -p tcp --dport $sshport -j ACCEPT
sudo ufw allow $sshport
sudo ufw allow 443
sudo ufw allow 7000
sudo ufw allow 7500
sudo ufw enable | echo "y"

echo -e "\e[31m如有问题输入systemctl start ssh && systemctl enable ssh && systemctl restart sshd(.service)\e[0m"
sudo systemctl restart sshd

echo -e "\e[35mEND！\e[0m"
